CREATE TABLE `acquisto` (
  `id_ordine` int(11) NOT NULL,
  `id_articolo` int(11) NOT NULL,
  `stato` varchar(100) NOT NULL DEFAULT 'pending',
  `prezzo` double DEFAULT NULL,
  `data` date NOT NULL,
  `quantit√†` int(11) NOT NULL,
  `lettura` int(11) DEFAULT '0',
  PRIMARY KEY (`id_ordine`,`id_articolo`,`data`),
  KEY `id_articolo` (`id_articolo`),
  CONSTRAINT `acquisto_ibfk_1` FOREIGN KEY (`id_ordine`) REFERENCES `ordine` (`id_ordine`),
  CONSTRAINT `acquisto_ibfk_2` FOREIGN KEY (`id_articolo`) REFERENCES `articolo` (`id_articolo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `articolo` (
  `id_articolo` int(11) NOT NULL AUTO_INCREMENT,
  `nome` varchar(255) NOT NULL,
  `descrizione` text,
  `foto` varchar(255) DEFAULT 'img_prodotti/immagine.jpg',
  `prezzo` double NOT NULL,
  `media_recensioni` double NOT NULL DEFAULT '0',
  `n_recensioni` int(11) NOT NULL DEFAULT '0',
  `negozio` varchar(255) NOT NULL,
  `data_inserimento` date NOT NULL,
  `categoria_1` varchar(255) NOT NULL,
  `categoria_2` varchar(255) DEFAULT NULL,
  `categoria_3` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_articolo`),
  KEY `categoria_1` (`categoria_1`),
  KEY `categoria_2` (`categoria_2`),
  KEY `categoria_3` (`categoria_3`),
  KEY `negozio` (`negozio`),
  CONSTRAINT `articolo_ibfk_1` FOREIGN KEY (`categoria_1`) REFERENCES `categoria` (`nome_categoria`),
  CONSTRAINT `articolo_ibfk_2` FOREIGN KEY (`categoria_2`) REFERENCES `categoria` (`nome_categoria`),
  CONSTRAINT `articolo_ibfk_3` FOREIGN KEY (`categoria_3`) REFERENCES `categoria` (`nome_categoria`),
  CONSTRAINT `articolo_ibfk_4` FOREIGN KEY (`negozio`) REFERENCES `negozio` (`nome`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8;
