CREATE TABLE `ordine` (
  `id_ordine` int(11) NOT NULL AUTO_INCREMENT,
  `user` varchar(255) NOT NULL,
  `totale` double NOT NULL,
  `data` date NOT NULL,
  `pagamento` varchar(255) DEFAULT NULL,
  `modalit√†` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_ordine`,`data`),
  KEY `user` (`user`),
  CONSTRAINT `ordine_ibfk_1` FOREIGN KEY (`user`) REFERENCES `utente` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `recensione` (
  `utente` varchar(255) NOT NULL,
  `id_articolo` int(11) NOT NULL,
  `testo` varchar(255) DEFAULT NULL,
  `voto` int(11) NOT NULL,
  PRIMARY KEY (`utente`,`id_articolo`),
  KEY `id_articolo` (`id_articolo`),
  CONSTRAINT `recensione_ibfk_1` FOREIGN KEY (`utente`) REFERENCES `utente` (`email`),
  CONSTRAINT `recensione_ibfk_2` FOREIGN KEY (`id_articolo`) REFERENCES `articolo` (`id_articolo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `segnalazione` (
  `id_messaggio` int(11) NOT NULL AUTO_INCREMENT,
  `id_mittente` varchar(255) NOT NULL,
  `id_destinatario` varchar(255) NOT NULL,
  `id_ordine` int(11) NOT NULL,
  `id_articolo` int(11) NOT NULL,
  `data_acquisto` date NOT NULL,
  `oggetto` varchar(255) NOT NULL,
  `testo` varchar(255) NOT NULL,
  `data` date NOT NULL,
  `stato` varchar(100) DEFAULT 'aperta',
  `conseguenza` varchar(1) DEFAULT NULL,
  `lettura` int(11) DEFAULT '0',
  PRIMARY KEY (`id_messaggio`),
  KEY `id_mittente` (`id_mittente`),
  KEY `id_destinatario` (`id_destinatario`),
  KEY `id_ordine` (`id_ordine`),
  KEY `id_articolo` (`id_articolo`),
  CONSTRAINT `segnalazione_ibfk_1` FOREIGN KEY (`id_mittente`) REFERENCES `utente` (`email`),
  CONSTRAINT `segnalazione_ibfk_2` FOREIGN KEY (`id_destinatario`) REFERENCES `utente` (`email`),
  CONSTRAINT `segnalazione_ibfk_3` FOREIGN KEY (`id_ordine`) REFERENCES `acquisto` (`id_ordine`),
  CONSTRAINT `segnalazione_ibfk_4` FOREIGN KEY (`id_articolo`) REFERENCES `acquisto` (`id_articolo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `utente` (
  `nome` varchar(100) NOT NULL,
  `cognome` varchar(150) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `avatar` varchar(255) DEFAULT 'img/default.png',
  `data_registrazione` date NOT NULL,
  `data_conferma_registrazione` date DEFAULT NULL,
  `tipo_utente` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
